for x in s1:
    a = lst1.count(x)
    print(a)
    d1[x] = a
    print(d1)
    print(len(d1), 'length d1')



sorted_x = sorted(d1.items(), key=lambda x: x[1], reverse=True)

print(sorted_x)

lstfinal = []
for x,y in sorted_x:
    print(x,y)
    a = x * y
    lstfinal.append(a)

print(lstfinal)

